// import React from 'react';

import { Route, Routes } from "react-router";

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<HomePage/>}/>
        <Route path="/" element={<CryptoPage/>}/>
        </Routes>
    </>
      );
}
